class App extends React.Component {
  componentDidMount() {
    this.props.getShop();
  }
  render() {
    return (
      <div className="app-wrapper">
        <Suspense fallback={"..."} />
        <Navbar />
        <div className="app-wrapper-content">
          <Suspense fallback={<Preloader />}>
            <Route path="/shop" render={() => <ShopContainer />} />
          </Suspense>
          <Route path="/library" render={() => <LibraryContainer />} />
          <Route path="/settings" render={() => <SettingsContainer />} />
          <Route path="/wishlist" render={() => <WishlistContainer />} />
          <Route path="/gamepage" render={(props) => <GamePage {...props} />} />
          <Route path="/game" render={() => <Game />} />
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  shopPage: state.shopPage,
});

export const AppContainer = connect(mapStateToProps, { getShop })(App);

export default App;
